        Token\",\"symbol\":\"CHRP\",\"coingecko_coin_id\":\"chirpley\",\"image_url\":\"https://assets.coingecko.com/coins/images/27243/small/Chirpley-Logo_200x200.png?1696526293\",\"websites\":[\"https://chirpley.ai\"],\"description\":\"Introduction\\r\\n\\r\\nChirpley
        is the world\u2019s first automated, peer-to-peer, all-in-one influencer marketplace
        specifically focussed on nano and micro influencers. Chirpley will provide
        marketers with the freedom to act fast and effectively, thanks to the possibility
        of a 1-click marketing bomb.\\r\\n\\r\\nProduct\\r\\n\\r\\nChirpley is an
        independent and fully decentralized marketplace to match brands and businesses
        with nano (1\u20135k followers) and micro-influencers (5\u201350k followers).
        Brands have been slow to realize that targeting smaller influencers is more
        lucrative, as their engagement level is almost 600% higher than for big influencers\u2014Chirpley
        allows exactly this by giving both brands and influencers free access to its
        platform to connect.\\r\\n\\r\\nProblem\\r\\n\\r\\nFor brands and businesses,
        running influencer campaigns manually is extremely time-consuming and inefficient.
        Furthermore, it is difficult for brands and businesses to understand how much
        they should pay influencers to promote their products and services.\\r\\nFor
        nano and micro-influencers, way less opportunities exist than for big and
        well-known influencers. Further, smaller influencers often get compensated
        in companies\u2019 goods and services, rather than cash.\\r\\n\\r\\nSolution\\r\\n\\r\\nChirpley
        is the world\u2019s first decentralized peer-to-peer influencer marketplace.
        A decentralized ecosystem powered by artificial intelligence and machine learning,
        which matches nano and micro-influencers with brands. Chirpley\u2019s algorithm
        then calculates a fair price for a range of services from tweets, retweets,
        likes, video posts, etc. based on an influencer\u2019s amount of impressions
        and engagement.\\r\\nThis automated setup allows brands to leverage many smaller
        influencers easily and effortlessly with complete cost transparency, while
